// This is all adapted from the source provided at:
// http://www.mattpalmerlee.com/2012/04/05/fun-with-hexagon-math-for-games/

var Hex = Hex || {};

Hex.Point = function(x, y) {
	this.X = x;
	this.Y = y;
};

Hex.Rectangle = function(x, y, width, height) {
	this.X = x;
	this.Y = y;
	this.Width = width;
	this.Height = height;
};

Hex.Line = function(x1, y1, x2, y2) {
	this.X1 = x1;
	this.Y1 = y1;
	this.X2 = x2;
	this.Y2 = y2;
};

// determines the side length of a hexagon, given its height and width
Hex.get_z = function(width, height) {
}

// The main attraction
Hex.Hexagon = function(id, vis, xpos, ypos, width, height, z) {

	console.log(id + "," + xpos + "," + ypos + "," + width + "," + height + "," + z)

	var x = xpos * width;
	if (ypos % 2 === 1)
		x += width / 2;
	var y = ypos * (height - (height-z)/2);

	console.log("creating hex at (" + x + ", " + y + ")");

	this.Points = [];//Polygon Base
	var x1 = null;
	var y1 = null;

	x1 = (width / 2);
	y1 = (height - z)/2;
	this.Points.push(new Hex.Point(x1 + x, y));
	this.Points.push(new Hex.Point(width + x, y1 + y));
	this.Points.push(new Hex.Point(width + x, y1 + z + y));
	this.Points.push(new Hex.Point(x1 + x, height + y));
	this.Points.push(new Hex.Point(x, y1 + z + y));
	this.Points.push(new Hex.Point(x, y1 + y));
	
	this.Id = id;
	this.vis = vis;
	
	this.x = x;
	this.y = y;
	this.x1 = x1;
	this.y1 = y1;
	
	this.TopLeftPoint = new Hex.Point(this.x, this.y);
	this.BottomRightPoint = new Hex.Point(this.x + width, this.y + height);
	this.MidPoint = new Hex.Point(this.x + (width / 2), this.y + (height / 2));
	
	this.P1 = new Hex.Point(x + x1, y + y1);
	
	this.selected = false;
};
	
/**
 * draws this Hexagon to the canvas
 * @this {Hex.Hexagon}
 */
Hex.Hexagon.prototype.draw = function(ctx) {

	if(this.vis === "A")
		ctx.fillStyle = "#CCCCFF";
	else if (this.vis === "B")
		ctx.fillStyle = "#FFB280";
	else if (this.vis === "AB" || this.vis === "BA")
		ctx.fillStyle = "#FF99FF";
	else
		ctx.fillStyle = this.vis;

	ctx.strokeStyle = "black";

	ctx.lineWidth = 1;
	ctx.beginPath();
	ctx.moveTo(this.Points[0].X, this.Points[0].Y);
	for(var i = 1; i < this.Points.length; i++)
	{
		var p = this.Points[i];
		ctx.lineTo(p.X, p.Y);
	}
	ctx.closePath();
	ctx.fill();
	ctx.stroke();

	var to_print = "";
	
	if(this.Id)
	{

		ctx.font = "bolder 8pt Trebuchet MS,Tahoma,Verdana,Arial,sans-serif";
		if (this.Id.charAt(0) === "A") {
			ctx.fillStyle = "#0000FF"
			if (this.Id.length === 1)
				to_print = "Home"
			else {
				to_print = this.Id.substring(1);
				ctx.font = "bolder 14pt Trebuchet MS,Tahoma,Verdana,Arial,sans-serif";
			}

		} else if (this.Id.charAt(0) === "B") {
			ctx.fillStyle = "#FF6600"
			if (this.Id.length === 1)
				to_print = "Home"
			else {
				to_print = this.Id.substring(1);
				ctx.font = "bolder 14pt Trebuchet MS,Tahoma,Verdana,Arial,sans-serif";
			}

		} else {
			ctx.fillStyle = "#000000"
			to_print = this.Id;
		}

		
		ctx.textAlign = "center";
		ctx.textBaseline = 'middle';

		ctx.fillText(to_print, this.MidPoint.X, this.MidPoint.Y);
	}
};

// Returns true if the point is inside the rectangul containing the hexagon
Hex.Hexagon.prototype.isInHexBounds = function(/*Point*/ p) {
	if(this.TopLeftPoint.X < p.X && this.TopLeftPoint.Y < p.Y &&
	   p.X < this.BottomRightPoint.X && p.Y < this.BottomRightPoint.Y)
		return true;
	return false;
};

//grabbed from:
//http://www.developingfor.net/c-20/testing-to-see-if-a-point-is-within-a-polygon.html
//and
//http://www.ecse.rpi.edu/Homepages/wrf/Research/Short_Notes/pnpoly.html#The%20C%20Code

// Returns true if the given point is inside the hexagon
Hex.Hexagon.prototype.Contains = function(/*Point*/ p) {
	var isIn = false;
	if (this.isInHexBounds(p))
	{
		//turn our absolute point into a relative point for comparing with the polygon's points
		//var pRel = new Hex.Point(p.X - this.x, p.Y - this.y);
		var i, j = 0;
		for (i = 0, j = this.Points.length - 1; i < this.Points.length; j = i++)
		{
			var iP = this.Points[i];
			var jP = this.Points[j];
			if (
				(
				 ((iP.Y <= p.Y) && (p.Y < jP.Y)) ||
				 ((jP.Y <= p.Y) && (p.Y < iP.Y))
				//((iP.Y > p.Y) != (jP.Y > p.Y))
				) &&
				(p.X < (jP.X - iP.X) * (p.Y - iP.Y) / (jP.Y - iP.Y) + iP.X)
			   )
			{
				isIn = !isIn;
			}
		}
	}
	return isIn;
};

var drawHexGrid = function(input, num_x, num_y, width, height)
{
	//solve quadratic to get side length
	var a = -3.0;
	var b = (-2.0 * width);
	var c = (Math.pow(width, 2)) + (Math.pow(height, 2));
	var z = (-b - Math.sqrt(Math.pow(b,2)-(4.0*a*c)))/(2.0*a);

	var total_width = (num_x + 0.5) * width;
	var total_height = (num_y + 0.5) * (height - (height-z)/2);

	var canvas = document.getElementById("hexCanvas");
	var ctx = canvas.getContext('2d');
	ctx.fillStyle = "black";
	ctx.clearRect(0, 0, total_width, total_height);

	if (input){
		for (var i=0; i<input.length; i++)
		{
			var node = input[i];
			console.log(JSON.stringify(node));
			xpos = node.coord[0];
			ypos = node.coord[1];
			if (node.id != "")
				var id = node.id;
			else
				var id = "";
				// var id = "(" + xpos + ", " + ypos + ")";
			console.log("(" + xpos + ", " + ypos + ")");
			new Hex.Hexagon(id, node.vis, xpos, ypos, width, height, z).draw(ctx);
		}
	}
}

var drawHexMap = function(color, num_x, num_y, width, height, offx, offy, refill)
{
	if (offx == null)
		offx = 0;
	if (offy == null)
		offy = 0;
	if (refill == null)
		refill = true;

	//solve quadratic to get side length
	var a = -3.0;
	var b = (-2.0 * width);
	var c = (Math.pow(width, 2)) + (Math.pow(height, 2));
	var z = (-b - Math.sqrt(Math.pow(b,2)-(4.0*a*c)))/(2.0*a);

	var total_width = (num_x + 0.5) * width;
	var total_height = (num_y + 0.5) * (height - (height-z)/2);

	var canvas = document.getElementById("hexCanvas");
	var ctx = canvas.getContext('2d');
	if (refill){
		ctx.fillStyle = "#466287";
		ctx.fillRect(0, 0, 1000, 1000);
	}
	for (var i=0; i<num_x; i++) {
		for (var j=0; j<num_y; j++){
			var coord = "(" + i + ", " + j + ")";
			console.log(coord);
			new Hex.Hexagon(coord, color, i+offx, j+offy, width, height, z).draw(ctx);
		}
	}
}

